jQuery(document).ready(function () {
  "use strict";
  app_modalbox();
  app_page_transition();
  app_trigger_menu();
  app_my_progress();
  app_circular_progress();
  app_portfolio_popup();
  app_news_popup();
  app_service_popup();
  app_cursor();
  app_imgtosvg();
  app_popup();
  app_portfolio();
  app_data_images(); 
  app_mycarousel();
  hashtag();
  app_ripple();
  app_moving_box();
  jQuery(window).load("body", function () {
    app_my_load();
  });
});
function app_modalbox() {
  "use strict";
  jQuery(".app_all_wrap").prepend(
    '<div class="app_modalbox"><div class="box_inner"><div class="close"><a href="#"><i class="icon-cancel"></i></a></div><div class="description_wrap"></div></div></div>'
  );
}
function app_page_transition() {
  "use strict";
  var section = jQuery(".app_section");
  var allLi = jQuery(".transition_link li");
  var button = jQuery(".transition_link a");
  var wrapper = jQuery(".app_all_wrap");
  var enter = wrapper.data("enter");
  var exit = wrapper.data("exit");
  button.on("click", function () {
    var element = jQuery(this);
    var href = element.attr("href");
    if (element.parent().hasClass("app_button")) {
      jQuery('.menu .transition_link a[href="' + href + '"]').trigger("click");
      hashtag();
      return false;
    }
    var sectionID = jQuery(href);
    var parent = element.closest("li");
    if (!parent.hasClass("active")) {
      allLi.removeClass("active");
      wrapper.find(section).removeClass("animated " + enter);
      if (wrapper.hasClass("opened")) {
        wrapper.find(section).addClass("animated " + exit);
      }
      parent.addClass("active");
      wrapper.addClass("opened");
      wrapper
        .find(sectionID)
        .removeClass("animated " + exit)
        .addClass("animated " + enter);
      jQuery(section).addClass("hidden");
      jQuery(sectionID).removeClass("hidden").addClass("active");
    }
    return false;
  });
}
function app_trigger_menu() {
  "use strict";
  var hamburger = jQuery(".app_topbar .trigger .hamburger");
  var mobileMenu = jQuery(".app_mobile_menu");
  var mobileMenuList = jQuery(".app_mobile_menu ul li a");
  hamburger.on("click", function () {
    var element = jQuery(this);
    if (element.hasClass("is-active")) {
      element.removeClass("is-active");
      mobileMenu.removeClass("opened");
    } else {
      element.addClass("is-active");
      mobileMenu.addClass("opened");
    }
    return false;
  });
  mobileMenuList.on("click", function () {
    jQuery(".app_topbar .trigger .hamburger").removeClass("is-active");
    mobileMenu.removeClass("opened");
    return false;
  });
}
function app_my_progress() {
  "use strict";
  jQuery(".progress_inner").each(function () {
    var progress = jQuery(this);
    var pValue = parseInt(progress.data("value"), 10);
    var pColor = progress.data("color");
    var pBarWrap = progress.find(".bar");
    var pBar = progress.find(".bar_in");
    pBar.css({ width: pValue + "%", backgroundColor: pColor });
    setTimeout(function () {
      pBarWrap.addClass("open");
    });
  });
}
function app_circular_progress() {
  "use strict";
  var ww = jQuery(window).width();
  var circVal;
  if (ww > 1400) {
    circVal = 120;
  } else if (ww >= 768) {
    circVal = 100;
  } else {
    circVal = 80;
  }
  jQuery(".circular_progress_bar .myCircle").each(function () {
    var element = jQuery(this);
    element.append('<span class="number"></span>');
    var value = element.data("value");
    element
      .circleProgress({
        size: circVal,
        value: 0,
        animation: { duration: 1400 },
        thickness: 3,
        fill: "#7d7789",
        emptyFill: "rgba(0,0,0,0)",
        startAngle: -Math.PI / 2,
      })
      .on("circle-animation-progress", function (event, progress, stepValue) {
        element
          .find(".number")
          .text(parseInt(stepValue.toFixed(2) * 100) + "%");
      });
    element.circleProgress("value", 1.0);
    setTimeout(function () {
      element.circleProgress("value", value);
    }, 1400);
  });
}
function app_portfolio_popup() {
  "use strict";
  var modalBox = jQuery(".app_modalbox");
  var button = jQuery(".app_portfolio .portfolio_popup");
  var closePopup = modalBox.find(".close");
  button.off().on("click", function () {
    var element = jQuery(this);
    var parent = element.closest(".list_inner");
    var content = parent.find(".hidden_content").html();
    var image = parent.find(".image .main").data("img-url");
    var details = parent.find(".details").html();
    modalBox.addClass("opened");
    modalBox.find(".description_wrap").html(content);
    modalBox
      .find(".popup_details")
      .prepend(
        '<div class="top_image"><img src="' +
          image +
          '" alt="" /><div class="main" data-img-url="' +
          image +
          '"></div></div>'
      );
    modalBox
      .find(".popup_details .top_image")
      .after('<div class="portfolio_main_title">' + details + "<div>");
    app_data_images();
    return false;
  });
  closePopup.on("click", function () {
    modalBox.removeClass("opened");
    modalBox.find(".description_wrap").html("");
    return false;
  });
}
function app_news_popup() {
  "use strict";
  var modalBox = jQuery(".app_modalbox");
  var button = jQuery(".app_news .news_list > ul > li .post_title h3 a");
  var closePopup = modalBox.find(".close");
  button.on("click", function () {
    var element = jQuery(this);
    var parent = element.closest("li");
    var content = parent.find(".news_hidden_details").html();
    var image = parent.data("img");
    var category = parent.find(".extra_metas").html();
    var title = parent.find(".post_title a").text();
    modalBox.addClass("opened");
    modalBox.find(".description_wrap").html(content);
    modalBox
      .find(".news_popup_informations")
      .prepend(
        '<div class="image"><img src="img/thumbs/4-2.jpg" alt="" /><div class="main" data-img-url="' +
          image +
          '"></div></div>'
      );
    modalBox
      .find(".news_popup_informations .image")
      .after(
        '<div class="details"><div class="meta">' +
          category +
          '</div><div class="title"><h3>' +
          title +
          "</h3></div><div>"
      );
    app_data_images();
    return false;
  });
  closePopup.on("click", function () {
    modalBox.removeClass("opened");
    modalBox.find(".description_wrap").html("");
    return false;
  });
}
function app_service_popup() {
  "use strict";
  var modalBox = jQuery(".app_modalbox");
  var button = jQuery(".app_service .service_list ul li .app_full_link");
  var closePopup = modalBox.find(".close");
  button.on("click", function () {
    var element = jQuery(this);
    var parent = element.closest(".list_inner");
    var elImage = parent.find(".popup_service_image").attr("src");
    var title = parent.find(".title").html();
    var content = parent.find(".service_hidden_details").html();
    modalBox.addClass("opened");
    modalBox.find(".description_wrap").html(content);
    modalBox
      .find(".service_popup_informations")
      .prepend(
        '<div class="image"><img src="img/thumbs/4-2.jpg" alt="" /><div class="main" data-img-url="' +
          elImage +
          '"></div></div>'
      );
    app_data_images();
    modalBox
      .find(".service_popup_informations .image")
      .after('<div class="main_title"><h3>' + title + "</h3></div>");
    return false;
  });
  closePopup.on("click", function () {
    modalBox.removeClass("opened");
    modalBox.find(".description_wrap").html("");
    return false;
  });
}
function app_preloader() {
  "use strict";
  var isMobile = /Android|webOS|iPhone|iPad|iPod|BlackBerry/i.test(
    navigator.userAgent
  )
    ? true
    : false;
  var preloader = $("#preloader");
  if (!isMobile) {
    setTimeout(function () {
      preloader.addClass("preloaded");
    }, 800);
    setTimeout(function () {
      preloader.remove();
    }, 2000);
  } else {
    preloader.remove();
  }
}
function app_my_load() {
  "use strict";
  var speed = 500;
  setTimeout(function () {
    app_preloader();
  }, speed);
}
function app_cursor() {
  "use strict";
  var myCursor = jQuery(".mouse-cursor");
  if (myCursor.length) {
    if ($("body")) {
      const e = document.querySelector(".cursor-inner"),
        t = document.querySelector(".cursor-outer");
      let n,
        i = 0,
        o = !1;
      (window.onmousemove = function (s) {
        o ||
          (t.style.transform =
            "translate(" + s.clientX + "px, " + s.clientY + "px)"),
          (e.style.transform =
            "translate(" + s.clientX + "px, " + s.clientY + "px)"),
          (n = s.clientY),
          (i = s.clientX);
      }),
        $("body").on(
          "mouseenter",
          "a,.app_topbar .trigger, .cursor-pointer",
          function () {
            e.classList.add("cursor-hover"), t.classList.add("cursor-hover");
          }
        ),
        $("body").on(
          "mouseleave",
          "a,.app_topbar .trigger, .cursor-pointer",
          function () {
            ($(this).is("a") && $(this).closest(".cursor-pointer").length) ||
              (e.classList.remove("cursor-hover"),
              t.classList.remove("cursor-hover"));
          }
        ),
        (e.style.visibility = "visible"),
        (t.style.visibility = "visible");
    }
  }
}
function app_imgtosvg() {
  "use strict";
  jQuery("img.svg").each(function () {
    var jQueryimg = jQuery(this);
    var imgClass = jQueryimg.attr("class");
    var imgURL = jQueryimg.attr("src");
    jQuery.get(
      imgURL,
      function (data) {
        var jQuerysvg = jQuery(data).find("svg");
        if (typeof imgClass !== "undefined") {
          jQuerysvg = jQuerysvg.attr("class", imgClass + " replaced-svg");
        }
        jQuerysvg = jQuerysvg.removeAttr("xmlns:a");
        jQueryimg.replaceWith(jQuerysvg);
      },
      "xml"
    );
  });
}
