function hashtag() {
  "use strict";
  var ccc = $(".app_header .menu .ccc");
  var element = $(".app_header .menu .active a");
  $(".app_header .menu a").on("mouseenter", function () {
    var e = $(this);
    currentLink(ccc, e);
  });
  $(".app_header .menu").on("mouseleave", function () {
    element = $(".app_header .menu .active a");
    currentLink(ccc, element);
    element.parent().siblings().removeClass("mleave");
  });
  currentLink(ccc, element);
}
function currentLink(ccc, e) {
  "use strict";
  if (!e.length) {
    return false;
  }
  var left = e.offset().left;
  var width = e.outerWidth();
  var menuleft = $(".app_header .menu").offset().left;
  e.parent().removeClass("mleave");
  e.parent().siblings().addClass("mleave");
  ccc.css({ left: left - menuleft + "px", width: width + "px" });
}
