function app_moving_box() {
  "use strict";
  var wrapper = $(".app_news");
  var list = wrapper.find(".news_list > ul > li");
  if (!$(".fn_moving_box").length) {
    $("body").append('<div class="fn_moving_box"></div>');
  }
  var box = $(".fn_moving_box");
  list
    .on("mouseenter", function () {
      var element = $(this);
      var image = element.data("img");
      var ellOffset = element.offset().top;
      if (image === "") {
        box.removeClass("opened");
        return false;
      }
      box.addClass("opened");
      box.css({ backgroundImage: "url(" + image + ")", top: ellOffset + "px" });
    })
    .on("mouseleave", function () {
      box.removeClass("opened");
    });
}
